// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconMenuSvg } from '../../../content/images/svg';

// application

export default class QuickSearch extends Component {
    render() {
        return (
            <div className="quick-search">
                <div className="quick-search__nav-bar">
                    <div className="quick-search__button">
                        <IconMenuSvg className="departments__button-icon" />
                    </div>
                    <div className="quick-search__form">

                        <label>
                            Quick search
                        </label>
                        <div className="quick-search__form-input">
                            <input type="text" />
                            <div className="">
                            </div>
                        </div>
                    </div>
                    <div className="quick-search__menu">

                    </div>
                </div>
            </div>
        );
    }
}
